function twoDigit(n) {
	return n > 9 ? "" + n : "0" + n;
}

StringeePhone.prototype.setRecentCalls = function (array) {
	//var noRecentCall = "<div class='no-recent-call'>You currently <br>don't have any call log.</div>";
	var html = '';

	var arrLength = Object.keys(array).length;
	var arrObj = Object.keys(array);
	var arrObjLen = arrObj.length;
	var arrVals = Object.values(array);

	// console.log(array);
	// console.log(arrLength);
	if (array.length > 0 || arrLength > 0) {
		for (var i = 0; i < arrObjLen; i++) {
			var dateWrap = arrObj[i];
			var currentDate = new Date()
			var today = twoDigit(currentDate.getDate())
			var yesterday = twoDigit(currentDate.getDate() - 1)
			var month = twoDigit(currentDate.getMonth() + 1)
			var year = currentDate.getFullYear()
			var setDate = today + "-" + month + "-" + year;
			var setDateBefore = yesterday + "-" + month + "-" + year;
			html += '<div class="call-wrapper">';

			if (setDate === dateWrap) {
				html += '<div class="activity-date">' + lang.today + '</div>';
			} else if (setDateBefore === dateWrap) {
				html += '<div class="activity-date">' + lang.yesterday + '</div>';
			} else {
				html += '<div class="activity-date">' + dateWrap + '</div>';
			}

			var calls = arrVals[i];
			for (var a = 0; a < calls.length; a++) {
				var call = calls[a];
				html += '<div class="wrap-activity-group">';
				html += '<div class="wrap-activity-item display-flex">';
				html += '<div class="activity-icon">';
				if (call.answer_time > 0 && call.direction == 1) {
					//call in received
					html += '<img src=' + window.parent.StringeeSoftPhone.baseUrl + 'images/icon-call-in.svg />';
				} else if (call.direction == 0) {
					//call out received
					html += '<img src=' + window.parent.StringeeSoftPhone.baseUrl + 'images/icon-call-out.svg />';
				} else if ((call.direction == 1 && call.enqueue_time > 0) || call.direction == 0 || call.direction == 2) {
					//call in missed
					html += '<img src=' + window.parent.StringeeSoftPhone.baseUrl + 'images/icon-call-miss.svg />';
				}
				html += '</div>';
				html += '<div class="activity-info">';
				html += '<div class="activity-phone">' + '+' + call.customer_number + '</div>';
				html += '<div class="activity-via">' + call.account_name + '</div>';
				html += '</div>';
				if (call.start_time) {
					var formatDateTime = new Date(parseInt(call.start_time)).toLocaleTimeString("en-US");
					html += '<div class="activity-time">' + formatDateTime + '</div>';
				}
				html += '<div class="activity-more">';
				html += '<img src=' + window.parent.StringeeSoftPhone.baseUrl + 'images/icon-arrow-point-to-right.svg />';
				html += '</div>';
				html += '</div>';
				html += '</div>';
			}
			html += '</div>';
		}
		$('#list-recent-calls').html(html);

		$('.wrap-activity-group').on('click', function () {
			var selectedCall = '';
			selectedCall = $(this).find('.activity-phone').html();
			$('#page-diapad input').val(selectedCall);
			$('#btnToolPad').trigger('click');
		});
	} else {
		html += '<div class="no-recent-call">You currently <br>don' + "'" + 't have any call log.</div>';
		$('#list-recent-calls').html(html);
	}
};

