StringeePhone.prototype.setAutoPickUp = function (val, type) {

	if (type == 'force') {
		var theAudioAutopickup = null;
		theAudioAutopickup = document.createElement('audio');
		theAudioAutopickup.setAttribute("playsinline", "");
		theAudioAutopickup.loop = false;
		theAudioAutopickup.setAttribute("preload", "auto");
		theAudioAutopickup.setAttribute("autoplay", "");
		theAudioAutopickup.onended = function () {
			theAudioAutopickup.setAttribute('src', '');
			theAudioAutopickup = null;
		};
	}

	if (val) {
		theAudioAutopickup && theAudioAutopickup.setAttribute('src', window.parent.StringeeSoftPhone.baseUrl + 'audio/' + window.parent.StringeeSoftPhone.lang + '_auto_pickup_on.mp3');
		$('.auto-pick-call').addClass('disabled');
		$('#autopickcheckbox').attr('disabled', true)
		$("#autopickcheckbox").attr("checked", true)
		stringeePhone.setAutoPickCall('true');
		window.parent.StringeeSoftPhone.autoPickUp = true;
	} else {
		theAudioAutopickup && theAudioAutopickup.setAttribute('src', window.parent.StringeeSoftPhone.baseUrl + 'audio/' + window.parent.StringeeSoftPhone.lang + '_auto_pickup_off.mp3');
		$('.auto-pick-call').removeClass('disabled');
		$('#autopickcheckbox').attr('disabled', false)
		$("#autopickcheckbox").attr("checked", false)
		stringeePhone.setAutoPickCall('false');
		window.parent.StringeeSoftPhone.autoPickUp = false;
	}
}

